content.text:
the sea otter inhabits nearshore environments, where it dives to the sea floor to forage. it preys mostly on marine invertebrates such as sea urchins, various mollusks and crustaceans, and some species of fish. its foraging and eating habits are noteworthy in several respects. its use of rocks to dislodge prey and to open shells makes it one of the few mammal species to use tools. in most of its range, it is a keystone species, controlling sea urchin populations which would otherwise inflict extensive damage to kelp forestecosystems.&#91;3&#93; its diet includes prey species that are also valued by humans as food, leading to conflicts between sea otters and fisheries.
an adult's 32 teeth, particularly the molars, are flattened and rounded for crushing rather than cutting food.&#91;51&#93;seals and sea otters are the only carnivores with two pairs of lower incisor teeth rather than three;&#91;52&#93; the adult dental formula is 3.1.3.12.1.3.2.&#91;53&#93; the teeth and bones are sometimes stained purple as a result of ingesting sea urchins.&#91;54&#93;
the sea otter has a metabolic rate two or three times that of comparatively sized terrestrial mammals. it must eat an estimated 25 to 38% of its own body weight in food each day to burn the calories necessary to counteract the loss of heat due to the cold water environment.&#91;55&#93;&#91;56&#93; its digestive efficiency is estimated at 80 to 85%,&#91;57&#93; and food is digested and passed in as little as three hours.&#91;28&#93; most of its need for water is met through food, although, in contrast to most other marine mammals, it also drinks seawater. its relatively large kidneys enable it to derive fresh water from sea water and excrete concentrated urine.&#91;58&#93;the sea otter is diurnal. it has a period of foraging and eating in the morning, starting about an hour before sunrise, then rests or sleeps in mid-day.&#91;59&#93; foraging resumes for a few hours in the afternoon and subsides before sunset, and a third foraging period may occur around midnight.&#91;59&#93; females with pups appear to be more inclined to feed at night.&#91;59&#93; observations of the amount of time a sea otter must spend each day foraging range from 24 to 60%, apparently depending on the availability of food in the area.&#91;60&#93;sea otters spend much of their time grooming, which consists of cleaning the fur, untangling knots, removing loose fur, rubbing the fur to squeeze out water and introduce air, and blowing air into the fur. to casual observers, it appears as if the animals are scratching, but they are not known to have lice or other parasites in the fur.&#91;61&#93; when eating, sea otters roll in the water frequently, apparently to wash food scraps from their fur.&#91;62&#93;under each foreleg, the sea otter has a loose pouch of skin that extends across the chest. in this pouch (preferentially the left one), the animal stores collected food to bring to the surface. this pouch also holds a rock, unique to the otter, that is used to break open shellfish and clams.&#91;63&#93; at the surface, the sea otter eats while floating on its back, using its forepaws to tear food apart and bring it to its mouth. it can chew and swallow small mussels with their shells, whereas large mussel shells may be twisted apart.&#91;64&#93; it uses its lower incisor teeth to access the meat in shellfish.&#91;65&#93;
to eat large sea urchins, which are mostly covered with spines, the sea otter bites through the underside where the spines are shortest, and licks the soft contents out of the urchin's shell.&#91;64&#93;nursing lasts six to eight months in californian populations and four to twelve months in alaska, with the mother beginning to offer bits of prey at one to two months.&#91;82&#93; the milk from a sea otter's two abdominal nipples is rich in fat and more similar to the milk of other marine mammals than to that of other mustelids.&#91;83&#93; a pup, with guidance from its mother, practices swimming and diving for several weeks before it is able to reach the sea floor. initially, the objects it retrieves are of little food value, such as brightly colored starfish and pebbles.&#91;63&#93; juveniles are typically independent at six to eight months, but a mother may be forced to abandon a pup if she cannot find enough food for it;&#91;84&#93; at the other extreme, a pup may nurse until it is almost adult size.&#91;78&#93; pup mortality is high, particularly during an individual's first winter&#160;– by one estimate, only 25% of pups survive their first year.&#91;84&#93; pups born to experienced mothers have the highest survival rates.&#91;85&#93;in a few northern areas, fish are also eaten. in studies performed at amchitka island in the 1960s, where the sea otter population was at carrying capacity, 50% of food found in sea otter stomachs was fish.&#91;151&#93; the fish species were usually bottom-dwelling and sedentary or sluggish forms, such as hemilepidotus hemilepidotus and family tetraodontidae.&#91;151&#93; however, south of alaska on the north american coast, fish are a negligible or extremely minor part of the sea otter's diet.&#91;18&#93;&#91;152&#93; contrary to popular depictions, sea otters rarely eat starfish, and any kelp that is consumed apparently passes through the sea otter's system undigested.&#91;153&#93;the individuals within a particular area often differ in their foraging methods and prey types, and tend to follow the same patterns as their mothers.&#91;154&#93; the diet of local populations also changes over time, as sea otters can significantly deplete populations of highly preferred prey such as large sea urchins, and prey availability is also affected by other factors such as fishing by humans.&#91;18&#93; sea otters can thoroughly remove abalone from an area except for specimens in deep rock crevices,&#91;155&#93; however, they never completely wipe out a prey species from an area.&#91;156&#93; a 2007 californian study demonstrated, in areas where food was relatively scarce, a wider variety of prey was consumed. surprisingly, though, the diets of individuals were more specialized in these areas than in areas where food was plentiful.&#91;125&#93;sea otters have the thickest fur of any mammal, which makes them a common target for many hunters. archaeological evidence indicates that for thousands of years, indigenous peoples have hunted sea otters for food and fur. large-scale hunting, part of the maritime fur trade, which would eventually kill approximately one million sea otters, began in the 18th century when hunters and traders began to arrive from all over the world to meet foreign demand for otter pelts, which were one of the world's most valuable types of fur.&#91;21&#93;some of the sea otter's preferred prey species, particularly abalone, clams, and crabs, are also food sources for humans. in some areas, massive declines in shellfish harvests have been blamed on the sea otter, and intense public debate has taken place over how to manage the competition between sea otters and humans for seafood.&#91;188&#93;many facets of the interaction between sea otters and the human economy are not as immediately felt. sea otters have been credited with contributing to the kelp harvesting industry via their well-known role in controlling sea urchin populations; kelp is used in the production of diverse food and pharmaceutical products.&#91;190&#93; although human divers harvest red sea urchins both for food and to protect the kelp, sea otters hunt more sea urchin species and are more consistently effective in controlling these populations.&#91;191&#93;e. lutris is a controlling predator of the red king crab (paralithodes camtschaticus) in the bering sea, which would otherwise be out of control as it is in its invasive range, the barents sea.&#91;192&#93; (berents otters, lutra lutra, occupy the same ecological niche and so are believed to help to control them in the berents but this has not been studied.)&#91;192&#93; the health of the kelp forest ecosystem is significant in nurturing populations of fish, including commercially important fish species.&#91;190&#93; in some areas, sea otters are popular tourist attractions, bringing visitors to local hotels, restaurants, and sea otter-watching expeditions.&#91;190&#93;
